    const [post, setPost] = useState(null);
    const baseURL = "https://jsonplaceholder.typicode.com/posts";

    useEffect(() => {
        axios.get(`${baseURL}/1`).then((response) => {
            console.log(response.data);
            setPost(response.data);
        }
        );
    }, []);
    return (
        <div>
            {/* <h5>{post.id }</h5>
